import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import { useEffect, useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

import AuthPage from "./pages/AuthPage";
import ResetPasswordPage from "./pages/ResetPasswordPage";
import HomePage from "./pages/HomePage";
import AccountPage from "./pages/AccountPage";
import CountryPage from "./pages/CountryPage";
import PackagePage from "./pages/PackagePage";
import CategoryPage from "./pages/CategoryPage";
import BookPage from "./pages/BookPage";
import AdminPage from "./pages/AdminPage"; // Fixed typo from "AdminPaje"
import AdminListingsPage from "./pages/AdminListingsPage";
import AdminEditListingPage from "./pages/AdminEditListingsPage";

// Protected Route component to restrict access based on authentication and optional role
function ProtectedRoute({ children, allowedRole = null }) {
  const [isAuthorized, setIsAuthorized] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem("jwt");
    if (!token) {
      localStorage.setItem("error", "Please log in to access this page");
      navigate("/login");
      return;
    }

    axios
      .get("/api/users/me", { headers: { Authorization: `Bearer ${token}` } })
      .then(({ data }) => {
        if (allowedRole && data.role !== allowedRole) {
          localStorage.setItem("error", "Unauthorized access. Redirecting to home...");
          setIsAuthorized(false);
          navigate("/home");
        } else {
          setIsAuthorized(true);
        }
      })
      .catch(() => {
        localStorage.setItem("error", "Invalid session. Please log in again.");
        setIsAuthorized(false);
        navigate("/login");
      });
  }, [navigate, allowedRole]);

  if (isAuthorized === null) {
    return <div>Loading...</div>;
  }

  return isAuthorized ? children : null;
}

export default function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<AuthPage />} />
        <Route path="/login" element={<AuthPage />} />
        <Route path="/reset-password" element={<ResetPasswordPage />} />

        {/* Protected routes for authenticated users */}
        <Route
          path="/home"
          element={
            <ProtectedRoute>
              <HomePage />
            </ProtectedRoute>
          }
        />
        <Route
          path="/account"
          element={
            <ProtectedRoute>
              <AccountPage />
            </ProtectedRoute>
          }
        />
        <Route
          path="/destinations/:code"
          element={
            <ProtectedRoute>
              <CountryPage />
            </ProtectedRoute>
          }
        />
        <Route
          path="/packages/:pid"
          element={
            <ProtectedRoute>
              <PackagePage />
            </ProtectedRoute>
          }
        />
        <Route
          path="/flights"
          element={
            <ProtectedRoute>
              <CategoryPage category="flights" />
            </ProtectedRoute>
          }
        />
        <Route
          path="/hotels"
          element={
            <ProtectedRoute>
              <CategoryPage category="hotels" />
            </ProtectedRoute>
          }
        />
        <Route
          path="/events"
          element={
            <ProtectedRoute>
              <CategoryPage category="events" />
            </ProtectedRoute>
          }
        />
        <Route
          path="/book/:category/:id"
          element={
            <ProtectedRoute>
              <BookPage />
            </ProtectedRoute>
          }
        />

        {/* Admin route with role-based protection */}
        <Route
          path="/admin"
          element={
            <ProtectedRoute allowedRole="ROLE_ADMIN">
              <AdminPage />
            </ProtectedRoute>
          }
  />
   <Route
    path="/admin/:category"
    element={
      <ProtectedRoute allowedRole="ROLE_ADMIN">
        <AdminListingsPage />
      </ProtectedRoute>
    }
  />
  <Route
    path="/admin/:category/:id/edit"
    element={
      <ProtectedRoute allowedRole="ROLE_ADMIN">
        <AdminEditListingPage /> {/* implement similarly */}
      </ProtectedRoute>
    }
  />


      </Routes>
    </BrowserRouter>
  );
}
